a5606955ecf88c7ebaf9de6066df6397110c0db6:
query GetPosts {
  reportedPostTypes(orderBy: createdAt) {
    severityScore
    userId
    recordId
    derivedContext
    derivedContextExplanation
    postText
    postUrl
  }
}

94f6c861e14f63cb9d120908bf630b76a4c553c3:
query GetReputations {
  reputationTypes(orderBy: createdAt, first: 50) {
    userId
    reputationScore
    postCount
    platform
    offenseCount
    lastOffenseTimestamp
    firstOffenseTimestamp
    username
  }
}
